# To run this script without changing your system's execution policy, you can use the following command:
# powershell.exe -ExecutionPolicy Bypass -File "<Path_to_your_script>\AlertWebHistory.ps1"
# Replace <Path_to_your_script> with the actual path to this file.

# ==============================================================================
# SCRIPT CONFIGURATION AREA
#
# Use this section to configure the script's behavior.
# ==============================================================================

# This is where you will paste your Base64 encoded file data.
# The `[string]` cast is important for multiline strings.
#
# IMPORTANT: Paste your Base64 content directly between the "@" and the closing "@".
# Do not add any extra spaces or characters after the final "@" on the line.
#
[string]$base64Content = @"

"@

# The hardcoded name for the file to be saved to disk.
$fileName = "BrowsingHistoryView.exe"

# The path where the file will be saved.
# By default, this is set to the current directory where the script is run.
$savePath = Get-Location
$filePath = Join-Path -Path $savePath -ChildPath $fileName

# The name of the text file that will be generated by the executable.
$historyFile = "History.txt"
$historyFilePath = Join-Path -Path $savePath -ChildPath $historyFile

# The name of the python file that will be generated.
$pythonFile = "history.py"
$pythonFilePath = Join-Path -Path $savePath -ChildPath $pythonFile

# ==============================================================================
# SCRIPT LOGIC
#
# Do not modify the code below this line unless you know what you're doing.
# ==============================================================================

Write-Host "--- Starting File Processing ---"

# Check if the Base64 content placeholder has been replaced.
if ($base64Content.Trim() -eq '' -or $base64Content.Contains('PASTE YOUR BASE64')) {
    Write-Warning "The base64Content variable is empty or contains the placeholder text. Please paste your encoded data in the CONFIGURATION AREA."
    # Exit the script
    return
}

# Step 1: Decode the Base64 string and save the file.
Write-Host "Decoding Base64 content and saving to disk..."
try {
    # Convert the base64 string to a byte array.
    $bytes = [System.Convert]::FromBase64String($base64Content)

    # Save the byte array to the specified file path, overwriting if it exists.
    Set-Content -Path $filePath -Value $bytes -Encoding Byte -Force
    Write-Host "File '$fileName' successfully saved to '$filePath'."
}
catch {
    Write-Error "An error occurred while decoding the Base64 content. This is likely due to a corrupted or invalid Base64 string. Please check the content you pasted."
    Write-Error "Error details: $_"
    # Exit the script on error
    return
}

# Step 2: Run the decoded file with the specified arguments in the background.
Write-Host "Executing '$fileName' in the background with new arguments..."
$arguments = "/HistorySource 1", "/VisitTimeFilterType 5", "/VisitTimeFilterValue 15", "/StopIECacheTask 1", "/stext `"$historyFilePath`""
# The Start-Process command runs the executable and allows the script to continue.
Start-Process -FilePath $filePath -ArgumentList $arguments -NoNewWindow

# Step 3: Monitor for the file to complete (watching for the process to not be running).
Write-Host "Waiting for '$fileName' process to finish..."
# This loop will continue as long as the process is found.
while (Get-Process -Name "BrowsingHistoryView" -ErrorAction SilentlyContinue) {
    # Wait for 1 second before checking again to avoid high CPU usage.
    Start-Sleep -Seconds 1
}
Write-Host "'$fileName' process has completed."

# Add a 30-second delay to ensure the process fully exits and releases the file handle.
Write-Host "Waiting 30 seconds before cleanup to ensure file handles are released..."
Start-Sleep -Seconds 30

# Step 4: Process the History.txt file.
Write-Host "Processing the '$historyFile' file..."
# Check if the History.txt file exists.
if (Test-Path -Path $historyFilePath) {
    try {
        # Define the output file path.
        $outputFile = $pythonFilePath

        # Read the content of the input file.
        $content = Get-Content -Path $historyFilePath -Raw

        # Split the content into entries based on the separator.
        $entries = $content -split "=================================================="

        # Loop through each entry and parse the data.
        foreach ($entry in $entries) {
            if ($entry.Trim()) { # Skip empty entries.
                $historyEntry = @{}
                $lines = $entry.Trim() -split "`n"
                
                foreach ($line in $lines) {
                    if ($line -match ":(.+)") {
                        $key = $line.Substring(0, $line.IndexOf(':')).Trim()
                        $value = $line.Substring($line.IndexOf(':') + 1).Trim()
                        $historyEntry[$key] = $value
                    }
                }

                # Convert the history entry to JSON format and save it to the output file.
                $historyEntry | ConvertTo-Json -Depth 10 | Set-Content -Path $outputFile -Force

                Write-Host "Converted entry to '$outputFile'."

                # Pause for 2 seconds.
                Start-Sleep -Seconds 2
            }
        }
        Write-Host "Finished processing '$historyFile'."
    }
    catch {
        Write-Error "An error occurred while processing '$historyFile': $_"
        # The script will continue to the cleanup phase even if this fails.
    }
}
else {
    Write-Warning "Could not find '$historyFile' to process. Skipping."
}


# Step 5: Cleanup - remove all generated files and the script itself.
Write-Host "--- Starting Cleanup ---"

# Define the paths to be removed.
$filesToDelete = @($filePath, $historyFilePath, $pythonFilePath)

foreach ($file in $filesToDelete) {
    if (Test-Path -Path $file) {
        Write-Host "Removing '$file'..."
        Remove-Item -Path $file -Force
    }
    else {
        Write-Host "File '$file' not found, skipping removal."
    }
}

# The final step is to remove this script.
# `$PSCommandPath` is an automatic variable that holds the path of the script.
Write-Host "Removing this PowerShell script from the disk."
Remove-Item -Path $PSCommandPath -Force

Write-Host "Cleanup complete. Exiting script."
